export const anotherName = (name) => {
return (dispatch)=>{
    fetch("https://jsonplaceholder.typicode.com/users").
    then(res=>res.jason()).
    then(res2=>{
        dispatch({type:'CHANGE_NAME',
        payload:res2.name})

    })
}

}
